import React from "react";
import { useParams } from "react-router-dom";

const NotePage = () => {
  const { id } = useParams();
  const [note, setNote] = useState(null);

  useEffect(() => {}, []);

  const getNote=()=>{
    fetch(`/api/notes/`)
  }

  return (
    <div>
      <h3>Single note - {id}</h3>
    </div>
  );
};

export default NotePage;
